import { Routes, Route } from 'react-router-dom'

const AppRoutes = () => {

    return (
        <Routes>
            <Route path='/' element={<h1>Hello there</h1>}> </Route>
            <Route path='/sessions' element={<h1>Sesiones aqui</h1>}> </Route>

        </Routes>
    )
}

export default AppRoutes
